import { Component, ElementRef, ViewChild } from '@angular/core';
import { SectionAnimationsService } from 'src/app/service/section-animation.service';

@Component({
  selector: 'what-we-offer',
  templateUrl: './what-we-offer.component.html',
  styleUrls: ['./what-we-offer.component.scss']
})
export class WhatWeOfferComponent {
  @ViewChild('sectionAnimation', { static: true }) sectionAnimation!: ElementRef;

  constructor(private animationService: SectionAnimationsService) {}

  ngAfterViewInit() {
// Use ElementRef to get the native element of the component
const mainElement: HTMLElement = this.el.nativeElement;

// Use querySelectorAll to get all elements with a specific class
const sectionElements = mainElement.querySelectorAll('.your-section-class');

// Iterate over the elements and apply the animation
sectionElements.forEach((element: HTMLElement) => {
  this.sectionAnimationsService.playSectionGlobalAnimation(element);
});
  }
}
